package com.wind.mybatis.pojo;import org.springframework.format.annotation.DateTimeFormat;import javax.persistence.Column;import javax.persistence.Id;import java.util.Date;public class Memory {    @Id    private Integer id;    private Integer userid;    private Integer travellerid;    private Integer ticketid;    @Column(name = "buyDate")    @DateTimeFormat(pattern = "yyyy-MM-dd")    private Date buydate;    @Column(name = "goDate")    @DateTimeFormat(pattern = "yyyy-MM-dd")    private Date godate;    /**     * @return id     */    public Integer getId() {        return id;    }    /**     * @param id     */    public void setId(Integer id) {        this.id = id;    }    /**     * @return userid     */    public Integer getUserid() {        return userid;    }    /**     * @param userid     */    public void setUserid(Integer userid) {        this.userid = userid;    }    /**     * @return travellerid     */    public Integer getTravellerid() {        return travellerid;    }    /**     * @param travellerid     */    public void setTravellerid(Integer travellerid) {        this.travellerid = travellerid;    }    /**     * @return ticketid     */    public Integer getTicketid() {        return ticketid;    }    /**     * @param ticketid     */    public void setTicketid(Integer ticketid) {        this.ticketid = ticketid;    }    /**     * @return buyDate     */    public Date getBuydate() {        return buydate;    }    /**     * @param buydate     */    public void setBuydate(Date buydate) {        this.buydate = buydate;    }    /**     * @return goDate     */    public Date getGodate() {        return godate;    }    /**     * @param godate     */    public void setGodate(Date godate) {        this.godate = godate;    }}